import React from 'react';
import Tag from './Tag';

const Tags = () => {
    return (
        <div>
            <section>
                <div
                    className="max-w-7xl mx-auto px-5 py-6 lg:px-0 flex gap-2 border-b overflow-y-auto"
                >
                    <Tag></Tag>
                </div>
            </section>
        </div>
    );
};

export default Tags;
